export const enum WORK_STATUS {
  WORKING = 1,
  DEPARTURE = 2
}
export const enum COURSE_TYPE {
  PERSONAL = 1,
  PERSONAL_TEAM = 2,
  TEAM = 3
}
export const enum IDENTITY {
  STAFF = 1,
  SALE = 2,
  TEAM_COACH = 3,
  PARSONAL_COACH = 4
}
